  static String gameplay2048Summary =
      'Killer2048 is a new addictive number puzzle game based on simple addition and division. Similar to the classic 2048 puzzle game, you slide Addition tiles and merge them to create bigger tiles. The twist comes in with Division tiles! A Division tile can be added anytime and anywhere on the board throughout the game. Make sure you guard your biggest tiles against getting cut in half. Get ready for a new challenge because this game is designed to make you sweat!';

  static String feature2048OneLeaderboards =
